original_question:
Tam giác $ABC$ là tam giác cân, với $AB=AC$ và đường cao $AM=11.$ Giả sử có một điểm $D$ trên $\overline{AM}$ với $AD=10$ và $\angle BDC=3\angle BAC.$ Tìm chu vi của tam giác $ABC.$

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

